SUMINOE（スミノエ）タイルカーペット　PX3000シリーズ<br /><img src="https://image.rakuten.co.jp/konpo/cabinet/lib/stc-px3000img-001.jpg" alt="" height="810" width="600" border="0" /><br /><br /><table width="600" border="0" cellspacing="2" cellpadding="0"><tr><td>使用済みタイルカーペットを再生材として使用したPX3000シリーズ<br />スミノエ独自のリサイクル技術で、使用済みのタイルカーペットからバッキング材の再資源化に成功。バージン品と変わらないコストパフォーマンスを実現しました。</td></tr></table><br /><img src="https://image.rakuten.co.jp/konpo/cabinet/lib/stc-px3000kiji-001.jpg" alt="" height="870" width="600" border="0" /><br /><img src="https://image.rakuten.co.jp/konpo/cabinet/lib/stc-px3000kiji-002.jpg" alt="" height="680" width="600" border="0" /><br /><img src="https://image.rakuten.co.jp/konpo/cabinet/lib/stc-px3000kiji-003.jpg" alt="" height="680" width="600" border="0" /><br /><img src="https://image.rakuten.co.jp/konpo/cabinet/lib/stc-px3000img-002.jpg" alt="" height="690" width="600" border="0" /><br /><br /><table width="600" border="0" cellspacing="2" cellpadding="0"><tr><td>組成：ポリプロピレン（原着）100％<br />パイル形状：レベルループ・パイル長：3.0mm（＋－0.5mm）・全厚6.0mm（＋－0.5mm）<br />寸法：50cm×50cm<br />バッキング：特殊PVC（リサイクルバッキング）<br />防炎・制電・日本製<br /><br />※注意：ご注文は20枚単位となります。（20枚、40枚、60枚等）<br />※他の商品との同梱は承れませんのでご注意ください。<br />※返品・交換不可商品。<br />※代金引換不可。<br />※北海道、沖縄県及び離島地域は別途送料がかかります。</td></tr></table>
SUMINOE（スミノエ）タイルカーペット（px3001・px3002・px3003・px3004・px3005・px3006・px3007・px3008・px3009・px3010・px3011・px3012・px3013・px3014・px3015・px3016・px3017・px3018・px3019・px3020・px3021・px3022・px3023・px3024・px3025）・組成：ポリプロピレン（原着）100％・パイル形状：レベルループ・パイル長：3.0mm（＋－0.5mm）・全厚6.0mm（＋－0.5mm）・寸法：50cm×50cm・バッキング：特殊PVC（リサイクルバッキング）・防炎・制電・日本製、※注意：ご注文は20枚単位となります。（20枚、40枚、60枚等）※他の商品との同梱は承れませんのでご注意ください。※返品・交換不可商品。※北海道、沖縄県及び離島地域は別途送料がかかります。<br><br><img src="https://image.rakuten.co.jp/konpo/cabinet/lib/evidence-px3000.jpg" width="300" border="0" /><br />メーカー希望小売価格はメーカーカタログに基づいて掲載しています<style>
